window.bookSummaryJSON = "<p>Kyler Centaurus isn't your typical runaway. All he wanted was a quick trip to the legendary Fasti Sun Festival. Who <i>wouldn't </i>want to see new stars being born? Um, try Kyler's entire family. They couldn't care less about mind-blowing wonders of science.</p> <p>When an accidental launch sequence ends with Kyler hurtling through space on the family cruiser, the thrill of freedom is cut short by two space pirates determined to steal his ship. Not happening!</p> <p>Luckily, Kyler bumps into Fig, a savvy young Wanderer who makes a living by blowing up asteroids. She could really use a ride to Earth and Kyler could <i>really </i>use a hand with the pirates.</p> <p>But when Kyler learns the truth about Fig's mission, the two must put aside their differences long enough to stop a threat of astronomical proportions racing towards Earth....</p>"; 
